export const callSmartContractService = (request) => {
    const REGISTER_API_ENDPOINT = 'http://localhost:3000/api/v1/smart-contract';

    const parameters = {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(request.data)
    };

    return fetch(REGISTER_API_ENDPOINT, parameters)
      .then(response => {
        return response.json();
      })
      .then(json => {
        return json;
      });
  };
